import { Box, Drawer, makeStyles, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Typography } from "@material-ui/core";
import { Rowing } from "@material-ui/icons";

const drawerWidthRight = 280

const useStyles = makeStyles((theme) =>{
    return{
        root:{
            
        },
        navRight:{
            width: drawerWidthRight,
            //display:'none'
        },
        drawerPaperRight:{
            width : drawerWidthRight,
            backgroundColor:"#FFFFF",
            borderLeft:'0px'

        },

}})



  

const RightNav = ({ServerRow}) => {
    const classes = useStyles()
    return ( 
        <div>
            
            <Drawer
            elevation={0}
            variant = "permanent"
            anchor = 'right'
            classes = {{paper : classes.drawerPaperRight}}
            className={classes.navRight}
            >                
                <Box>
                    <Box m={2} display="flex" justifyContent="center">
                        <Typography gutterBottom>
                            Informations                                      
                        </Typography>
                    </Box>
                    
                    <Box>
                        <TableContainer>
                            <Table size="small">
                                <TableHead  >
                                    <TableRow >
                                        <TableCell size="small">Prod</TableCell>
                                        <TableCell size="small">h-Prod</TableCell>
                                        <TableCell size="small">DEV</TableCell>
                                    </TableRow>
                                </TableHead>
                                <TableBody>
                                {ServerRow.map((row) => { 
                                    
                                    if(row.name !==""){                               
                                        <TableRow key={row.name}>
                                        <TableCell component="th" scope="row" size="small">
                                            {row.name}
                                        </TableCell>
                                        <TableCell align="left" size="small">{row.hprod}</TableCell>
                                        <TableCell align="left" size="small">{row.dev}</TableCell>
                                        </TableRow>
                                    }
                                })}
                                </TableBody>
                            </Table>
                        </TableContainer>
                    </Box>
                </Box>
            </Drawer>
        
        </div> 
     );
}
 
export default RightNav
